import logo from './logo.svg';
import './App.css';
import axios from "axios";
import { useState, use } from 'react';

function App() {
  const [message, setMessage] = useState("")

  useEffect(() => {
    fetch("http://localhost:3000/data-scrapper")
      .then((res) => res.json())
      .then((data) => setMessage(data.message));
  }, [])

  return (
    <div><p>{message}</p></div>
  );
}

export default App;
